import axios from 'axios';
import React from 'react'
import './Pages.css';

class OurCoaches extends React.Component {

    constructor(props){
        super(props);
        this.state = 
        {
            Coach: [],
        }
    }

    async FetchCoaches() {
        await axios.get("http://localhost:8080/coach/getCoach")
        .then((res) => {
            this.setState({
                Coach: res.data
            })
        });
    }

    componentDidMount(){
        this.FetchCoaches();
    }

    render() {
    return (
        <div className='coaches'>
            <div className='coaches-container'>
                <h1>GoForFit Coaches:</h1>
                <br/>
                <div>
                {this.state.Coach.map(coach => {
                    <>
                    <p>Name: {coach['firstName']} {coach['lastName']}</p>
                    <p>User Name: {coach['userName']}</p>
                    <p>Email: {coach['email']}</p>
                    <p>Born In: {coach['dayOfBirth']}/{coach['monthOfBirth']}/{coach['yearOfBirth']}</p>
                    <p>Height: {coach['height']}</p>
                    <p>Weight: {coach['weight']}</p>
                    <p>Phone Number: {coach['phoneNumber']}</p>
                    <p>Profession: {coach['sportKind']}</p>
                    <p>License Number: {coach['licenseNumber']}</p>
                    <p>Work Place ID: {coach['workPlaceId']}</p>
                    </>
                })}
                </div>
            </div>
        </div>
    )
    }
}

export default OurCoaches
